import React from "react";
import './User.css';

function User(props) {
  const ondeleteHandler = () => {
    const userid = props.id;
    props.onDelete(userid);
}
  return (
    <div className="nameDisplay">
      {props.name}
      
    </div>
  );
}

export default User;
